import React from 'react';
import { styled } from '@mui/material/styles';
import { Box , Toolbar , AppBar, Typography} from '@mui/material';

const HeaderStyled = styled(AppBar)`
  background: #2874f0;
  height:55px
 
`;

const Component = styled(Box)`
margin-left:12%;
line-height:0.60;
`
const SubHeading = styled(Box)`
font-size:10px;
font-style:italic;
margin-top:4px;
`

const Header = () => {
  return (
    <>
    <HeaderStyled>
    <Toolbar>
        <Component>
            <img src='https://static-assets-web.flixcart.com/www/linchpin/fk-cp-zion/img/flipkart-plus_8d85f4.png' alt="img..." style={{width:"75px"}} />
        <Box>
            <SubHeading>Explore 
                <Box component="span"  style={{color:"#ffe500",marginLeft:"2px"}}>Plus</Box>
            </SubHeading>
        </Box>
        </Component>
    </Toolbar>
    </HeaderStyled>
    </>
  )
}

export default Header
